 @RenanCancio  O Hulk é um jogador que precisa de se sentir acarinhado e importante. Sentir que pode partir para cima e se perder a bola não ser cobrado ou vaiado. Em 10 arranques o Hulk vai perder a bola talvez em 7 ou 8 ocasiões, mas em 3 é meio golo, entende? A torcida do Porto exigia-lhe que fosse para cima e que não tivesse medo de perder a bola, é essa confiança que o Hulk precisa e que nunca teve ao serviço do Brasil. Sem isso é apenas um bom jogador. A rematar de fora da área a 30 ou 40 metros da baliza é igual. Vai falhar muito mas se lhe pega bem é meio golo. E nós no Porto queriamos ver esse show do Hulk, mesmo a falhar era um espectáculo ver a capacidade e potência dele.
Nota: ele no Porto também teve extensões no cabelo e inclusive pintou de loiro. Não o deixem fazer isso. Torna-se um jogador banal. É uma maldição dele. :) 
Desfrutem do Hulk porque eu e nós aqui no Porto temos saudades desse tempo fantástico que ele passou por cá.  Para terem uma noção imaginem um ataque com Hulk, Falcao e James Rodriguez todos eles no auge e na mesma equipa. ;) Em 2011 limpamos tudo em Portugal e na Europa. Bons tempos!

